import React from "react";

interface BlogPostProps {
  title: string;
  date: string;
  excerpt: string;
}

const BlogPost: React.FC<BlogPostProps> = ({ title, date, excerpt }) => (
  <div
    style={{
      marginBottom: "20px",
      borderBottom: "1px solid #ccc",
      paddingBottom: "20px",
    }}
  >
    <h3>{title}</h3>
    <p>
      <small>{date}</small>
    </p>
    <p>{excerpt}</p>
    <a href="blogposts">Read more</a>
  </div>
);

export default BlogPost;
